values:
Did you know that another name for a red moon is a blood moon?&nbsp;

When I was little, everytime I saw a red moon I always associated it with blood. I believed that everytime one appeared, someone's blood has been spilled in the world.&nbsp;

Please tell me if you're okay.... AND TAKE YOUR GODDAMN MEDS SO YOU DON'T START COUGHING UP BLOOD AGAIN.

--------------------------------------
Which is worse? Coughing up blood or your lungs closing up, causing you to slowly suffocate?

YAY!!! WE MADE IT BACK.... UNINJURED...SOMEWHAT!! xDD; Let's see... Where to begin....&nbsp;

Good News: WE MADE IT TO SOMERSET.
Bad News: -.- ; We got lost along the way.

Good News: CHARMAINE (Sweet 16 celebrant) LOOKED AMAZING!!! (even though we were forced to attend her party ish )
Bad News: x'D ; ...... We er... kind of... er... How should I say this... Almost set the table on fire (LONG STORY BUT IT INVOLVED THE CANDLES!!)

Good News: YAY!! GOT TO SEE MY FRIENDS!!!
Bad News: ; ; We had to leave... And they had to leave to get back home as well...

SUPERLY AMAZING NEWS: WE GET TO SEE EACH OTHER AGAIN IN A FEW WEEKS (Or was it days?)&nbsp;

Reason being: .....ANDRE'S 16TH BIRTHDAY'S COMING UP!!! xDD; NO STUFFY DRESSES AND BAD DJs!!!&nbsp;

^o^; Andre brought up the idea to her parents (WOO!! ) to have her 16th birthday party at Six Flags... And her parents said maybe... Which normally means yes... So.... xDD; All hell shall break loose.&nbsp;

Bah. I'm so tired! Not from the party itself... @@; But from walking all over the place in high heels because I got lost in the hotel... (High heels hurt!)&nbsp;

&gt;o&lt; ; I can't wait to see you guys soon! You really know how to make the sad thoughts go away! ( &gt;.&gt; ; Not by holding me down to take medicine though... )

-----------------------------

xD; Despite getting lost and all the other incidents... This day wasn't so bad for once. It's actually a first!
